import {NavLink} from "react-router-dom";

interface NavLinks {
  navItems: any;

};

const NavLinks = (props:NavLinks) => {
    const {navItems} = props;

    const individualNavItems = navItems.map(navItem => {
        return (
            <NavLink
                exact
                to={navItem.link}
                activeClassName="active"
                key={navItem.label}
            >
                {navItem.label}
            </NavLink>
        );
    });

    return (
        {individualNavItems}
    );
};

export default NavLinks;
